import React, { useState } from "react";
import Popup from "./Popup";
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.bundle.min";
import { Button } from "react-bootstrap";

function Group() {
  const [showPopup, setShowPopup] = useState<boolean>(false);

  const handleOpenPopup = () => {
    setShowPopup(true);
  };

  const handleClosePopup = () => {
    setShowPopup(false);
  };
  return (
    <div className="table-responsive container py-3">
      <Button onClick={handleOpenPopup} className="btn btn-success mb-2">Add new member</Button>
      <Popup show={showPopup} onClose={handleClosePopup} title="Enter new member name" />
    <table className="table table-light container table-hover table-borderless table-primary align-middle">
      <thead>
        <tr>
          <th scope="col">#</th>
          <th scope="col">First</th>
          <th scope="col">Last</th>
          <th scope="col">Handle</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <th scope="row">1</th>
          <td>Mark</td>
          <td>Otto</td>
          <td>@mdo</td>
        </tr>
      </tbody>
    </table>
    </div>
  );
}

export default Group;
